import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">

      </header>
    </div>
  );
}

function urlList(props) {
  return (<div>List for URLs</div>); // Iterate through array of URL items, display key components of each one 
}

function urlItem(props) {
  return (<div>Single URL entry</div>); // Display each url item
}

function requestList(props) {
  return (<div>List for Requests</div>); // Iterate through array of request items, display key components of each one 
}

function requestItem(props) {
  return (<div>Single item entry</div>); // Display each request item
}

function requestBody(props) {
  return (<div>Body of single request</div>); // display body of request 
}

export default App;
